import React from 'react';

function Shop() {
  return (
    <div className="shop-content">
      <h1>쇼핑몰</h1>
      <div className="shop-space">
        <div className="space-item">제품 1</div>
        <div className="space-item">제품 2</div>
        <div className="space-item">제품 3</div>
        <div className="space-item">제품 4</div>
        <div className="space-item">제품 5</div>
      </div>
    </div>
  );
}

export default Shop; // 기본 내보내기
